function Api() {
    const getUsers = () => {
      return fetch("https://api.themoviedb.org/3/trending/all/day?api_key=4a54ab11d3721dac3c7f819587e24e14", {
        type: "GET",
      }).then((res) => res.json().then(console.log(res)));
    };

    return {
      getUsers,
    };
}

export default Api();
